// import React from "react";
import ReactDOM from "react-dom";
import React, { useState } from "react";
// import Card from "./Card";
// import contact from "./contact";
// import Detail from "./Detail";
// import emojipedia from "./emojipedia";
// import Emoji from "./Emoji";
// import Form from "./Form";




function App() {

const [fname ,setfname] = useState("");
const [lname,setlname] = useState("");

function handlechange(event){
    setfname(event.target.value);
}
function clicked(){
    setlname(fname,lname);

}

return (
    <div>
        <h1>Hello {fname} {lname}</h1>
        <input onChange={handlechange} name = "fname" value={fname} type="text" placeholder="Enter your first name" />
        <input onChange={handlechange} name = "lname" value={lname} type="text" placeholder="Enter your last name" />

        <button  onClick={clicked}>Submit</button> 
       </div>
)



}


export default App;
